import React from 'react'
import classes from './TodoItem.module.css'

const TodoItem: React.FC<{
  text: string
  removeTodo: (id: string | number | boolean) => void
}> = ({ text, removeTodo }) => {
  return (
    <li onClick={removeTodo} className={classes.item}>
      {text}
    </li>
  )
}

export default TodoItem
